jobs_results.description:
We are hiring a Flutter developer to bring the Salonkee experience to your smartphone. We are looking for someone passionate about performance, reliability and design with the experience and credentials to back up that passion. Someone who can take ownership of applications, solve technical challenges and take pride in their solutions and code.

The ideal candidate will have experience building great mobile applications, a good understanding of great UX/UI, and has already worked an applications available in the app store or play store. The role is based in Luxembourg, we are looking for candidates who live in Luxembourg, the neighbouring countries or are willing to relocate.

Your mission: You will help us with the development of our first mobile apps. We rely on your experience and allow you to contribute your own ideas to the design. Together we want to create the best possible user experience to be the number one booking app in the hairdressing and beauty sector.

In addition to the app for end customers, we also want to bring our B2B app to tablets and smartphones, opening up new use cases for salon workers.

The main areas of responsibility include:
• You work closely with colleagues from different areas to become an expert in the domain and to actively improve our product portfolio.
• You not only know common development principles, you also actively shape our development process to improve our quality every day.
• Quality and aesthetics are close to your heart and the features you develop make our platform a little better every day.

Basic Qualifications:
• Have worked on one or more iOS/Android apps developed with Flutter published on the AppStore or Google Play;
• 3+ years in iOS or Android software development;
• Over 2 years developing Flutter applications for mobile;
• Experience with third-party libraries and APIs;
• Being able to write dart packages;
• Knowledge of material guidelines and human interface guidelines;
• Understanding of the Agile development life-cycle;
• You know how to write testable code;
• You are willing to explore and try out new technologies;
• Experience in CI/CD;

We offer:
• The opportunity to actively contribute to the company's success in a responsible position
• A permanent full time contract
• Flat hierarchies and room for your own ideas
• An international team with colleagues from different countries as well as regular company events, free coffee, lunch vouchers
• An amazing company culture and lots of fun!

We are looking forward to getting to know you better and welcoming you on the Salonkee rocket ship!

This a Full Remote job, the offer is available from: Europe

This is a remote position.

We are urgently looking for a Full Remote Senior iOS Developers based in Spain. Candidates need to have a good level of English or willing to improve/learn.

This position is only open for employees, who would like to work remote. Candidates need to be willing to go to the office in Murcia for 5 days on a quarterly base.

Tasks and Responsibilities:

​
• Design and develop software solutions to client requirements;
• Participate in identifying problem areas and defining solutions;
• Able to articulate problems and solutions in non-technical language to stakeholders;
• Understand interactions and dependencies between software components;
• Support the product engineering lead(s) in project set up, execution and key ceremonies including backlog refinement, sprint planning, demos and retrospectives;
• Support learning and development activities for junior product engineering resources;

Profile:
• College / university degree, Bacc. Ing. Comp (or similar);
• +2 years of iOS mobile development experience (Swift, Objective-C, ...);
• +5 years of software development experience;
• Strong understanding of Apple’s design principles & interface guidelines;
• Candidates need to have a good level of English and/or willing to improve/learn;

Offered:
• Attractive salary package (employees);
• Career development training;
• English classes;

Interested: Please send your resume to
resume@jobs4java.eu

